import { createTheme, responsiveFontSizes } from "@mui/material/styles";
import TwentiethCentury from "./static/fonts/TwentiethCenturyforKenmoreMedium.ttf";

const themeBase = createTheme({
  palette: {
    primary: {
      main: "#D4218D",
      light: "#FFEDF8",
    },
  },
  components: {
    MuiCssBaseline: {
      styleOverrides: {
        "@font-face": {
          fontFamily: "TwentiethCentury",
          src: `url(${TwentiethCentury}) format('woff2')`,
        },
        body: {
          fontFamily: "TwentiethCentury, Arial, sans-serif",
        },
      },
    },
  },
});

const customTheme = responsiveFontSizes(themeBase);
export default customTheme;
